import React from 'react';
import { Card, CardActions, CardContent, CardMedia, Button, Typography } from '@material-ui/core';
// import ThumbUpAltIcon from '@material-ui/icons/ThumbUpAl';
// import DeleteIcon from '@material-ui/icons/Delete';
// import MoreHorizIcon from '@material-ui/icons/MoreHoriz';

import useStyles from './styles';

const Movie = ({ movie }) => {
    const classes = useStyles();

    return (
        <Card className={classes.card}>
        <CardMedia className={classes.media} image={movie.posterurl} title={movie.title} />
        <div className={classes.overlay}>
            <Typography variant="h6">{movie.title}</Typography>
            <Typography variant="body2">{movie.releaseDate}</Typography>
        </div>
        <div className={classes.details}>
            <Typography variant="body1" color="textSecondary">{movie.genres.map((genre) => `${genre} `)}</Typography> 
        </div>
        <CardContent>
            <Typography className="classes.title" variant="h5" gutterBottom>{movie.year}</Typography>
        </CardContent>

        </Card>
    );
}

export default Movie;
